package Loops;

public class ForLoopContinue {

	public ForLoopContinue() {
		// TODO Auto-generated constructor stub
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
for (int i=1;i<=100;i++) {
	if(i>=48 & i<=99) {
		continue;
	}
System.out.println(i);
}
	}

}
